export const LeftSection = styled.div``;

export const RightSection = styled.div`
  // background-color: black;
  float: left;
  width: 40%;
  height: 100%;
  // color: #fff;

  img {
    height: 1.5em;
    margin-top: 2em;
    margin-left: 14em;
  }
  img:hover {
    cursor: pointer;
  }
`;
